import React from 'react';
import { Route } from 'react-router-dom';
import PropTypes from 'prop-types';
import Login from '../Login/Login';

const Routes = props => {
    return (
        <>
            <Route exact path='/login' component={Login} />
        </>
    );
};

Routes.propTypes = {};

export default Routes;
